import React from "react";
import Matching from "./Matching";
import Notmatching from "./Notmatching";

const Slotm = (props) => {
  // let x = "‚ù§";
  // let y = "‚ù§";
  // let z = "üëç";

  let x = props.x;
  let y = props.y;
  let z = props.z;
  if ((props.x === props.y) && props.y === props.z) {
    return <Matching />;
  } else {
    return <Notmatching />;
  }
};
export default Slotm;
